Defendant Jermaine Rich in court with attorney Robert E Webb.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.   The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years with credit for 57 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION.   The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  
 * Court ordered defendant to provide a DNA sample.
 * Court ordered defendant to pay the costs, DNA surcharge, fees and disbursements of this action; cash bail on deposit to apply said costs; balance to be taken from prison funds not to exceed 25%; balance (if any remaining) to be paid while on extended supervision.

CONDITIONS OF EXTENDED SUPERVISION:
 - No contact with Ellen M.;
 - No contact with Myles T. or Game Stop located at 10400 West Silver Spring Drive, Milwaukee, Wisconsin (case 14CF1640);
 - No controlled substances or alcohol;
 - Urine screens;
 - AODA assessement; treatment if needed;
 - Cognitive thinking intervention counseling;
 - Anger management counseling;
 - Obtain high school diploma, HSED or GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - No contact with juvenile co-defendants  D.M. (10/18/97) or D. B. (9/05/97); or Angel D.;
 - Pay any balances remaining of the costs, surcharges, fees and disbursements.  Failure to pay amounts in full would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.

Defense counsel requested a report date; State objected.  Court denied defense request and ordered the defendant remanded.

